window.bookSummaryJSON = "<p><b>Ian Dunai is trapped in the only maze an arch-decemancer can't escape: time.</b>&nbsp;&nbsp;</p> <p>Only 1 percent of the population is blessed with magic affinity at birth. Fewer still have high enough affinities to rule. Ian’s decemancy eclipses all, granting him ultimate control over Death. He conquers cities with a thought and turns them into ruins with a gesture. But overwhelming power isn’t enough to escape the time loop or reveal its purpose.&nbsp;&nbsp;</p> <p>When Ian discovers a critical clue that he missed years ago, escape is finally at his fingertips.&nbsp;&nbsp;</p> <p>Little does he know, he's been stuck on layer one.&nbsp;&nbsp;&nbsp;</p>"; 
